INSERT INTO `comment` (`commentId`, `commentContent`, `commentDate`, `contractId`, `userId`) VALUES
(1, 'prueba 1', '2020-06-15 19:10:37', 327, 2),
(2, 'este proyecto fue asignado al ingeniero Jairo coronel a las 10:30 am del 16 de junio de 2020, se estima que debe estar concluido para hoy a las cuatro de la tarde ...', '2020-06-16 14:47:14', 327, 22),
(3, 'Se realizaron las revisiones del site permit al 95%, hace falta hacer el traffic control plan debido a que tenemos que cortar el pavimento de la centerville road y redactar los ultimos comentarios de la ciudad, se espera enviar el archivo para la 1:00 PM', '2020-06-16 14:55:23', 324, 22),
(4, 'se estan asignando a las 10:30 los calculos electricos y mecanicos al ingeniero cristofer sierra.', '2020-06-16 15:48:32', 326, 22),
(5, 'Esperando por ONCOR para la carga disponible  y el diagrama eléctrico del Ing Gary', '2020-06-16 16:48:49', 131, 2),
(6, 'Esperando que el cliente notarice una carta donde especificara el tipo de material que usara para que la ciudad se la apruebe y la someta al condado, desde que inicio el covid se complico todo y no sabemos que hará el cliente, por lo tanto estamos parados esperando por el.', '2020-06-16 16:51:49', 210, 2),
(7, 'Saro entrego una carta explicativa la semana pasada al inspector de la ciudad y estamos esperando respuesta.', '2020-06-16 16:54:06', 231, 2),
(8, 'Corrección Saro la semana pasada entrego los planos a la ciudad', '2020-06-16 16:55:36', 231, 2),
(9, 'Esperamos por el numero de contratista desde hace varios meses, para poder procesar el permiso por esta razón esta suspendido.', '2020-06-16 16:59:19', 254, 2),
(10, 'Esperando que la ciudad de respuesta, porque el cliente ha enviado varias veces el numero de contratista y lo han rechazado, ademas el envío un correo a la inspectora y no ha recibido respuesta.', '2020-06-16 17:01:03', 268, 2),
(11, 'Se esta solicitando por la ciudad agregar las etiquetas a todos los espacios. En los archivos previos hay una foto que indican los nombres qe se deben colocar.', '2020-06-16 19:20:40', 262, 6),
(12, 'Hoy se realizo una inpeccion al sitio de trabajo donde se observo  la excavacion para la fundacion y la forma ya preparada para vaciar el concreto. Segun lo observado y comentado por el cliente, se ha cambiado el proyecto a una edificacion mas pequena de 38 x 40 pies para el galpon mas 13 y 15 pies de cover hacia dos lados, uno hacia el frente de la piscina y otro proximo a la calle Dallas Dr. El cliente comenta que la ciudad ha preaprobado el proyecto con estas dimensiones y tambien pide cambiar la fundacion en el detalle de el espaciamiento de l=el metal sobre la losa que originalmente era de rebar #3@11\" y ahora se quiere colocar de rebar #4@18\" con beams a maximo 13 pies de separacion. Esta correccion habia sido comentada con el ingeniero y el la habia aprobado a priori por lo que recomendamos seguir estos lineamientos. Se debe actualizar la fundacion como pimera actividad y luego actualizar el resto de planos para la edificacion. Se cargara hoy mismo un levantamiento indicando como esta quedando la fundacion y tambien videos de referencia.', '2020-06-17 20:39:26', 255, 6),
(13, 'El registro de contratista del cliente esta vencido, la ciudad pide hoy que sea actualizado para poder avanzar con el prescreen.', '2020-06-18 20:43:24', 275, 6),
(14, 'Esperando que el cliente reciba el número de contratista actualizado por la ciudad para poderle procesar el permiso, ayer hablé con el y le envió correos a la ciudad pero no responde, sigue en espera.', '2020-06-19 03:38:10', 310, 2),
(15, 'Miercoles 6/17 \nLuisa Leal 1:00 pm\nModificaciónes en fachadas y Roof 70% de avance', '2020-06-19 14:20:30', 328, 6),
(16, 'hoy 19 de junio estamos iniciando el proyecto completo de harbor , necesitamos precisar si las instalaciones de plumbing y electrical son esquematicas o calculadas , se ha realicado la consulta via ws espersmos respuesta , se ha definido previamente  que los aires acondicionados son tipo split , por lo que deben calcularse y dimensionarse la capacidad de las unicdades. este proyecto ha sido asgnado para su direccion a la ingeniero maria celeste Camacho.', '2020-06-19 15:14:35', 261, 22),
(17, 'el 19 de junio 2020 a las 1100 ....Se informa que la arquitectura esta completa, el director del proyecto ( Ing Maria celeste Camacho ) espera por descargarla arquitectura para asignar el chequeo o calculo estructura....', '2020-06-19 15:19:36', 328, 22),
(18, 'Se requiere terminar el set de planos, los MEP seran solamente esquematicos y para el AC se usaran unidades de split es decir no se usara unidad central. El cliente esta pendiente de pasar un survey donde se ubicara la casa. Esta casa se ubicara en otra direccion.', '2020-06-19 16:03:27', 261, 6),
(19, '5700 Point La Vista\nMalakoff, TX 75148\nPoint La Vista, Lot 138, Henderson County\nEsta es la direcion del nuevo lote, en archivos previo cargare una imagen que muestra cual es el terreno y los datos que aparecen en el Appraisal Distric', '2020-06-19 16:32:01', 261, 6),
(20, 'Se aprobaron las modificaciones hechas en el R38 y se debe hacer ahora la verificacion de la estructura y MEP, que es esquematico. Ojo, se debe verificar las vias por donde van los ductos y que no interfieran con la estructura.', '2020-06-19 16:43:59', 325, 6),
(21, 'El ing Murillo pidio colocar informacion de el estudio de suelo sobre  los planos para referenciar de donde se han hecho los calculos.', '2020-06-19 16:46:37', 327, 6),
(22, 'En espera del floor plan para enviarselo a la persona que hizo el trabajo electrico para que nos de idea de como hizo las conexiones.', '2020-06-19 16:49:52', 326, 6),
(23, 'Ya los planos estan listos, solo esperamos por el survey para ubicar la casa.', '2020-06-19 16:52:31', 311, 6),
(24, 'La ciudad esta solicitando llenar la planilla para establecimiento de comida, para esto debe tener el certificado de manioulacion de alimentos y para esto debe tener el EIN de la empresa que va a abrir. Por esto ultimo es que esta parado.', '2020-06-19 17:01:08', 284, 6),
(25, 'El cliente no quiere pagar el Fee de la ciudad, solo esperamos por esto para avanzar.', '2020-06-19 17:01:57', 289, 6),
(26, 'Falta entregarle el Rescheck y se debe agregar dos pies de brick el ambos lados de la casa para darle continuidad al brick de la fachada del frente.', '2020-06-19 17:04:05', 270, 6),
(27, 'Solo esperamos por el plano de irrigacion para completar el nuevo set que se entregara a la ciudad.', '2020-06-19 17:05:38', 59, 6),
(28, 'Ya recibimos el dato de ONCOR solo falta el diagrama eléctrico del Ing Gary', '2020-06-19 17:07:33', 131, 6),
(29, 'Elpidio envio el plano de la findacion pero el Ing Murillo hizo unas correcciones que esperamos por hacer en produccion.', '2020-06-19 17:11:17', 255, 6),
(30, 'el calculo de la estructura le fue asignada al ing edwin garcia ....la cual iniciara tan pronto envie la maqueta de oak ....', '2020-06-19 19:22:27', 328, 22),
(31, 'para este proyecto hay que disenar y calcular elementos estructurales no standart  por lo que se equiere alargar la fecha de entrega , se estima para el miecoles 24  o jueves 25 de junio 2020...', '2020-06-20 00:27:13', 253, 22),
(32, 'En el reporte de Oncor dice que el servicio es 3 fases y el ingeniero habia dicho que era de 1 fase. El quedo de llamar a verificar esta información', '2020-06-20 22:54:47', 131, 6),
(33, 'Correcciones mandadas por el Ingeniero Murillo realizadas, el mencionaba colocar los Fire Lanes en el lote, sin embargo esas fire lanes no aplican porque el lote tiene cerca un hidrante lo suficiente cerca según el NFPA y los códigos de la ciudad para no requerir los fire lanes, me encargue de colocar una nota en la hoja C1.00 donde se describe la localización mediante coordenadas de fire hydrant, y las distancias reales y las máximas exigidas por los códigos para requerir o no Fire Lanes,  en el grading plan me encargue  de colocar las elevaciones inferiores y superiores del masonry wall y el retaining wall del lote, y en el plano de Water & wastewater se corrigio la gramatica de la nota de conexión de wastewater lateral service. Ya lo que falta es el irrigation para realizar la re-submital del site permit', '2020-06-21 18:55:15', 59, 14),
