(115, 'Con respecto a la parte de building el alcance del trabajo consta de lo siguiente:\n1. Se quiere agregar lavanderías individuales a cada apartamento con lavadora y secadora morocha (una encima de la otra), tenemos que determinar donde quedan mejor en cada apartamento. Esto traerá implicaciones eléctricas a tomar en cuenta. En cuanto a la parte estructural no tendra nada que ver porque se anadiran pareden de particion.\n2. Actualmente el sistema de calefaccion de agua es comun y se quiere colocar calentadores sin tanque (tank less water heater). Esto traera implicaciones electricas a tomar en cuenta.\n3.  El sistema de aire acondicionado se quiere reemplazar por unidades con split con un motor y varios ventiladores adentro. Para esto hay que ubicar donde iran las maquinas en la parte de afuera y como se soportaran, en los videos se muestran tres unidades que estaban fuera del edificio 1519 montadas a un costado.\n4. Se debe hacer el calculo eléctrico para determinar cual es el consumo necesario para cada apartamento.  La acometida de la luz principal ira a un tablero que se colocara frente a los apartamentos del lado de la calle que es la parte mas cercana a los postes donde están los transformadores, luego de este panel principal se colocaran subpaneles a cada apartamento.', '2020-06-29 20:32:41', 332, 6),
