(148, 'No hay comentario inicial, Se tiene un avance del 60% de las plantas de arquitectura existentes de los dos primeros edificios, se espera enviar las plantas existentes mañana (07/03/2020) al finalizar la jornada laboral. Se verificaron las distancias de las piezas sanitarios con relacion a las paredes del baño, y se confirma que cumplen de acuerdo al código IRC R307.1. Falta ubicar la zona de los Laundries en los apartamentos para las plantas propuestas. Luego de finalizar las plantas existentes se le entregara al ingeniero Sousa para que diseñe el sistema eléctrico de ambos edificios y las instalaciones mecánicas.', '2020-07-02 16:04:34', 332, 14),
(149, 'Se recibieron comentarios aparte al sistema indicando que  el trabajo consiste en re-digitalizar los planos tal como los originales (solo cambiaria el cajetín) y agregar los cambios sugeridos en notas por el ingeniero Murillo (Vía correo electrónico), el trabajo se esta ejecutando y lleva un avance del 70%, ya se digitalizaron las plantas y se revisaron, faltan los detalles y notas de los planos, además, incluir el cajetín de la empresa. Tiempo estimado de entrega a la oficina Dallas: hoy (07/02/2020) al final de la jornada laboral.', '2020-07-02 16:05:13', 333, 14),
(150, 'Proyectista encargado: Gloria Ampueda, Se esta trabajando en la propuesta de arquitectura (80% y se estima que  se tenga para el final de la jornada laboral, cuando mucho.', '2020-07-02 16:08:55', 331, 14),
(151, 'El Departamento de estructura recibió el archivo cad con la propuesta que se le envió al cliente para empezar con el detallado estructural, ya se realizo el calculo de la adición techada (del patio) y falta hacer el detallado y presentar toda la documentación en planos', '2020-07-02 16:37:31', 330, 14),
(152, 'Se recibió un nuevo correo del ingeniero eléctrico diciendo que no hemos estado haciendo lo que el pedía, esta claro que hay una falta de entendimiento por ambas partes, eso sin contar con las incoherencias que hemos tenido con respecto a sus cálculos en revisiones anteriores, estamos viendo como resolver esto pero no esta sencillo, ya tenemos al equipo frustrado sin saber que hacer ahora con los comentarios del ingeniero.', '2020-07-02 17:01:40', 131, 14),
(153, 'Se espera tener el 3D para hoy en la noche, para hacerle llegar la propuesta de ceiling al cliente, mañana continua el calculo estructural del proyecto', '2020-07-02 17:03:12', 253, 14),
(154, 'Se le dieron instrucciones al ingeniero Jairo Coronell para que recalculara el proyecto con una propuesta estructural partiendo de ejes constructivos y un esquema de pórticos resistentes a momento, se espera tener para mañana el calculo estructural, y el fin de semana el detallado estructural del proyecto.', '2020-07-02 17:05:56', 255, 14),
(155, 'Se tuvo una Reunión con Christopher y Sousa donde llegamos a un acuerdo con respecto a lo que el ingeniero mando a cambiar en los planos, ya Christopher esta haciendo dichas modificaciones y esperamos mandar la revisión esta tarde.', '2020-07-02 20:07:51', 131, 14),
(156, 'avance en un 90 % de la arquitectura incluyendo el modelo 3D , se estima enviarlo hoy al final de la Tarde....', '2020-07-03 14:06:27', 332, 22),
(157, 'Se recibieron los comentarios siguientes:  \nSaro/Jose:\n\nUna sola corrección en el Plano A-005 marcada como \"Post-it Note\". Pero si en todos los Planos falta y necesitan marcar(además ver instrucciones de Sherry Morris en su correo):\nEscalas excepto en Plano A-001. (De acuerdo a Planos recibidos).\nFlechas de Norte de acuerdo a Planos recibidos. En el Plano A-002 en \"LOCATION\" está invertida y en los Planos A-003,4,5 y 6 indicar Flecha de izquierda a derecha.\nSaludos,\n\nJuan Murillo.\n\nSe consultaran las observaciones, solo tenemos dos dudas:\n- El correo del ingeniero menciona unas instrucciones de un tal \"Sherry Morris\" que no tenemos, si las tienen por favor, re envíenla.\n- El ingeniero menciona cambiar la escala de los dibujos para que estén iguales a los de los planos originales, pero el proyecto lo estamos manejando en 24x26 de acuerdo a los requisitos del sistema,  las escalas del proyecto original están para un formato en 11x17, se va a hacer el cambio del formato a 11x17?', '2020-07-03 14:22:39', 333, 14),
(158, 'Arq.Gloria Ampueda 03-07-2020  HORA:10:00 am PROYECTO: 1385 Bent Tree Dr  ACTIVIDAD: Propuesta Arquitectónica. Progreso: 95%, se enviara hoy. en horas de la tarde.', '2020-07-03 14:23:11', 331, 22),
