(217, 'Se hizo medicion de dos edificios hoy, yo medi el 1507 y corresponden los archivos que estan cargados por mi a este edificio, solo hay medidas del primer piso que son 12 apartamentos. Jose midio el 1511 y cargara los archivos desde su usuario para diferenciar los archivos entre un edificio y otro.', '2020-07-12 00:56:08', 332, 6),
