(220, 'descargado el levantamiento de 1507 que le sera asignado al ing  johander, el 1511 este en proceso de descarga y se le asigno a la ing celeste. se esta trabajando en las instalaciones electricas del edificio 1519, se le asigno al ing jose sousa, aun no se ha definido el tiempo estimado de entrega, se estara informando de ello durante el dia. ademas se esta trabajando en la parte civil del proyecto, el ing elpidio se le delego esa parte, se tiene planificado que el dia de hoy se realice el site plan del proyecto.\n\ndurante el transcurso del dia los responsables se encargaran de indicar los tiempos estimados para la entrega de cada responsabilidad del proyecto', '2020-07-13 15:10:52', 332, 26),
(221, 'Se enviaron correcciones del ingeniero con una cola de otros mensajes donde se le explicA al ingeniero lo que se esta haciendo y finalmente el responde lo que pide. Esta en el correo esta informacion.', '2020-07-13 15:12:46', 298, 6),
