(225, 'se esta trabajando en correcciones de electricidad, plomeria, y set de plano estructural y de drenaje, espera ser entregado el dia miercoles, el proyectista encargado actualmente se encuentra indispuesto un tema de salud y eso representa una demora.', '2020-07-13 15:26:37', 261, 26),
(226, 'haciendo revisión de los comentarios del ing  murillo.', '2020-07-13 15:32:09', 298, 26),
(227, 'Segunda propuesta enviada', '2020-07-13 17:05:38', 331, 14),
(228, 'El cliente de Valwood aprobo los planos para terminarlos.', '2020-07-14 14:57:16', 330, 6),
(229, 'Enviado ayer en la noche el R15', '2020-07-14 15:12:33', 255, 14),
(230, 'Tenemos tres actividades de este proyecto en curso, a continuación se describen las actividades:  1. Calculo y diseño de las instalaciones MEP de los edificios 1519 y 1527. (El Ing. Sousa esta encargado del calculo en estos momentos, se estima que termine con ello entre hoy y mañana dependiendo de la respuesta que recibamos a una incógnita que no manejamos en producción;  Vamos a hacer un solo banco de transformación para los 5 edificios o vamos a hacer uno para cada edificio? no sabemos si cada edificio tiene una acometida propia conectada al servicio de la ciudad o si es una sola acometida para todos los edificios que hay en dicho lote, el calculo de la electricidad depende de una respuesta para esta incógnita) 2. Digitalización de los levantamientos de los edificios 1507 y 1511, (Johander informo que ya esta trabajando en la digitalización del edificio 1507, se estima que hoy finalice la digitalización y empiece a construir el modelo virtual BIM en Archicad, Celeste tiene el edificio 1511 e informa que tendrá la digitalización para esta noche para comenzar mañana con el modelo Virtual BIM,  se estima que los planos existentes de los edificios 1507 y 1511 se entreguen el jueves 14/07 en la tarde, no tenemos una hora fija aun. 3.  El proyecto Civil se empezara el día de hoy con la finalización del Site Plan, y durante el lapso de tiempo que va desde el día de hoy hasta el lunes 20 de julio se estima que se tengan listos los planos de Dimension Control, Paving, Erosion Control, Traffic Control, y Drainage. Nota: aun falta el levantamiento del ultimo edificio, se tiene planificado que Chirinos se encargue de digitalizar ese ultimo edificio una vez tengamos los archivos previos.', '2020-07-14 16:02:25', 332, 14),
(231, 'Se recibieron los tres correos del Cliente explicando cambios que quiere para la propuesta arquitectónica, se le asignaran a la Arq. Gloria para que realice los cambios al proyecto se estiman que estén listos y enviados para el día de mañana 07/15/2020 en la tarde.', '2020-07-14 16:17:54', 331, 14),
(232, 'El día de ayer se sostuvo una Reunión vía Zoom con el Ing. Jairo para explicarle los trabajos que habría que hacerle al proyecto de Valwood, esperábamos una respuesta favorable del cliente y esta mañana la recibimos le acabo de informar a Jario que necesitamos que la estructura este lista para mañana en la tarde, entonces, se espera que para ese momento se haya adelantado todo lo demas concerniente al proyecto y que  podamos entregarlo mas tardar el  jueves 16 de julio al mediodía.', '2020-07-14 16:36:33', 330, 14);
INSERT INTO `comment` (`commentId`, `commentContent`, `commentDate`, `contractId`, `userId`) VALUES
(233, 'El proyecto esta en curso pero hay unos puntos específicos que están retrasando este proyecto, a continuación los describo, El proyectista encargado es el Sr. Edgar, quien a reportado estar padeciendo de malestares asociados a gripe, el comenta que ha avanzado con el proyecto pero no tenemos constancia de cuanto es ese avance no solo por el tema de salud sino también por la falta de  conexión a internet, tiene que recurrir a la casa de una amiga para cargar y descargar archivos pero debido a la lluvia no ha podido hacerlo, le solicitamos que nos mande fotos via Whatsapp del proyecto para determinar un avance a estos momentos y estamos en espera de respuesta, mientras, me encargare (Elpidio) de ayudar a Mariaceleste con los demas problemas que ha presentado el proyecto para adelantar mientras esperamos la información que depende del Sr. Edgar, le pediré que tan pronto pueda, nos informe si esta en la disposición de enviarnos el archivo de proyecto que el lleva para asignar a otra persona mientras se recupera para no comprometer el proyecto ni al proyectista, de no ser así tendremos que ir a buscar el archivo a su casa, todos estos inconvenientes los pensamos solucionar hoy,  para poder continuar con el proyecto, tenemos además de los inconvenientes mencionados, un tema con el sistema de fundaciones de tipo losa reforzada el cual esta presentando serios problemas con respecto al terreno y a la topografía que nos suministro el cliente, esta tarde tendremos una Reunión donde vamos a formalizar con datos técnicos las posibles soluciones que tenemos y el coste cuantitativo que conlleva para el cliente. Luego de finalizar la Reunión nos comunicaremos con la Oficina Dallas para conversar esta situación con propuestas a base de  datos mas específicos.', '2020-07-14 17:46:12', 261, 14),
(234, 'Se recibieron los comentarios del ingeniero murillo y se procederá a delegar el proyecto al ingeniero Wilmer Quintana', '2020-07-14 18:04:20', 255, 14),
