(411, 'Jose/Saro/Elpidio:\n\nA continuación les doy las bases para cumplir con esta fase de Factibilidad:\n\nEn nuestra Propuesta prometimos hacer lo siguiente\n\nFeasibility\n \nPreliminary Site Plan including Parking Analysis and Fire Lane Layout.\nPreliminary Floodway Delineation requirements based on latest FEMA Maps.\nPreliminary Utilities and Stormwater Connection Plan to City Systems.\nPreliminary Building Layout.\nPre-Development Meeting.\n\nJose me indico que el Cliente nos dejó una Topografía del Terreno, pero yo no la he visto, nosotros pedimos como esencial la Topografía y el Estudio Geotécnico.\n\nAhora en resumen yo veo que tenemos que preparar 2 Planos:\nUn \"Preliminary Site Plan\" del Lote de 3.042 Acres, mostrando el Driveway en el lado Sur-Oeste, el Edificio de 2,500 Sq.Ft.  que sera \"Truck Repair and Warehouse with an Office and Restroom facilities\" con FFE = 427.00 minimo (100 Year Flood Elevation = 425.6) en la parte más alta de acuerdo a la topografía (lado Oeste) y \"New Floodway Delineation & Detention Pond\" a ser verificado con un estudio hidráulico en la siguiente fase de \"Site Development\". \nUn \"Preliminary Utilities & Stormwater Plan\" mostrando las conecciones a los Sistemas de la Ciudad.\nEl tiempo que estimamos para esta primera fase es de 1 mes, para concretar la reunión con la Ciudad \"Pre-Development Meeting\", por lo que los 2 planos indicados deberían estar para una primera revisión en 2 semanas. Y o pienso visitar el sitio este fin de semana para tener una mejor idea de las utilidades y el drenaje.\n\nSaludos,', '2020-07-31 19:23:57', 344, 2),
(412, 'el comentario de abajo lo hizo el ingeniero con respecto a este proyecto', '2020-07-31 19:25:03', 344, 2),
(413, 'the second floor lighting plan is the same as the first floor, but that is not the floor plan.  Can you check and send me the right electrical lighting plan for the second floor?', '2020-07-31 19:48:12', 298, 6),
