(420, 'Comentario de inspector de la ciudad Building code: Applicant needs to respond to the items below based on the 2015 building codes: 1. This project is a Group B occupancy. Therefore, it is being reviewed under the International Building Code (IBC). Delete the to the IRC on sheet G0.01. 2. The exterior wall insulation shall be R-13 + R-3.8c.i. or R-20 per Table C402.1.3 of the IECC and not the R-5 as shown on sheet A2.2. Amend this drawing and any other sheets with this reference. 3. Portable fire extinguishers shall be provided per 906 of the IBC. Revise the floor to show the fire extinguisher(s). 4. Toilet rooms that are open to the public shall have wall finishes within 2 feet of a service sink, urinal and water closets shall have a smooth, hard and nonabsorbent surface up to 4 feet above the floor per 1210.2.2 of the Dallas Building Code (DBC).. Amend the floor plan to provide the above information. 5. Due to the proximity to the property line clarify that the wall openings are not greater than 10% of the exterior wall area per Table 705.8 of the DBC. 6. A special inspection form will need to be completed for the project. The form can be found at the link below: https://dallascityhall.com/departments/sustainabledevelopment/buildinginspection/DCH%20documents/pdf/BI_Special_Inspection_Requirements.pdf Based on the information provided in the comment response(s) there may be some additional comment(s) generated.\nComentario insp Ciudad Dallas Water: Need utility drawing to review and need plat showing property has been platted as on lot, no crossing lot line with utility lines, Henry M. Renteria today is 07-14-2020.\nComentario de insp de la ciudad Arborist: Need Landscape Plan\nEl inspector de paving dijo que no se le habian hecho las cosas que pidio pero no sabemos que pidio, le pregunte hoy cuales son sus comentarios. El inspector de Zonning decia que no estaba plat y le envie el plat para que verifique su comentario.', '2020-08-03 14:30:21', 289, 6),
