(432, 'Jose/Saro/Elpidio:\n\nEste pasado sábado fui a ver el Lote de este nuevo proyecto. A continuación les doy los datos más relevantes:\nEn la topografía de By-Line Surveying del 01.22.18 muestra un \"Wire Fence\" que ya no existe.\nAl centro del terreno se ha producido una erosión causada por el agua que drena al Arroyo \"Creek\" en la parte posterior. Esta sería la ubicación natural para poner un canal de desagüe del Detention Pond al Creek.\nEn 2 archivos a continuacion les envio las fotos tomadas. Electricidad y agua (hay un hidrante) pude ver, pero no así \"Wastewater\". También \"Cable/AT&T\" al borde del \"Frontage Road\".\nSaludos,', '2020-08-03 15:03:45', 344, 2),
