(563, 'Se enviaron unos comentarios de parte del cliente por correo la semana pasada. Estas son:\nThere are no elevations for the building slab.  Detail 1/S1.01 indicates the slab to be some dimension above the existing grade.  If so, this will affect the pad prep quantities and pricing.  We just need to establish that dimension\nIf the pad is elevated, there are no details for a ramps, steps, etc up to the building.\nSheet A1.0 first notes that all structural information is for reference only and Contractor is to have a Structural Engineer review and design all structural elements. How do you want to handle?\nThere are some other disclaimers on the documents that put all the responsibility for the design of the building on the contractor, sheet S1.00 fort instance.  We would certainly not accept that responsibility\nThere is a Second Floor balcony area which is directly above the First Floor Fitness area.  The structure is wood but that is about all that is shown.  There are not details for flashing and waterproofing, topping slab, finishes, etc. \nWhat is the specified siding material\nElevations show Coal Canyon Stone up to the second level.  That is a natural stone product and I suspect very pricey.  Is that what they really want or should be price brick to match the surrounding buildings?', '2020-08-17 19:07:10', 298, 6),
(564, 'Ya enviados Cad actualizado por parte del Ing Chirinos. El ing Christofer se encuentra descargando el CAD con ultimas modificaciones para actualizar los planos de MEP respectivamente en conjunto con el Ing Sousa. El Ing Edwin se encuentra realizando unos pequeños cambios a la maqueta para ser mostrada al cliente y esperar la aprobación de los mismos.', '2020-08-17 19:46:03', 341, 14),
