(332, 96, 'P', 'Internal & External Remodeling', 'USDAL2000000096', 1, 2, '2020-06-29 00:00:00', 91, '1511', 'ANNEX', 'AVE', NULL, 'DALLAS', 'TX', 75204, 10, 26, 2, 'TYPE III', NULL, NULL, NULL, NULL, NULL, 'Dear Mr. Rodd:\r\n\r\nJD Rivero & ECIS are pleased to submit this proposal to provide professional services associated with the remodeling of the referenced project in DALLAS, TX.  Based on our perception of the overall project objectives for the commercial remodel, JDR & ECIS propose to perform the following tasks. \r\n\r\nCivil Engineering services \r\nThis phase of work will include the engineering and preparation of site construction plans for the civil work associated with the modifications and additions to this site.  The following are included in this scope of work: \r\n\r\n1.	New Site Plan based on new Survey tied to City Bench Mark(s).\r\n2.	New Parking Marking & Analysis. \r\n3            Establish Public Utilities Connections (Develop Plan based on actual connections to Public\r\n	Utilities).\r\n4.           Produce a Drainage Plan based on actual storm-water drainage conditions.	\r\n5.	Parking Paving Demolition Plan. \r\n6.           Parking New Paving and Drainage Inlets Reconstruction Plan.\r\n7.           Erosion & Pollution Control Plan (City Required for all Construction Operations).\r\n8.           Traffic Control Plan (City Required for Drive-way connections to City Pavement).\r\n9.	Attendance to City Coordination Meetings.  \r\n\r\nBuilding design services \r\nThis phase of work will include the engineering and preparation of construction plans for the building’s interior and exterior remodeling work associated with the additions and modifications to the existing building.  The following are included: \r\n\r\n1.	Floor plan (existing & modified). \r\n2.	Mechanical, Electrical and Plumbing (MEP) plans.\r\n3.	Section & Elevation plans.\r\n4.	Construction details. \r\n5.	Attendance to City Coordination Meetings.  \r\nScope of work:\r\n\r\nWe propose to have a Preliminary Phase to define the extent of the modifications and to review the existing information (Deed and others) and sketch-up the Client’s vision of the final internal and external arrangement. Also, approach the City to obtain Public information regarding Public Utilities, applicable Codes and Ordinances to proceed with the work to be code compliant. In this Proposal, we have not considered the following:\r\n1.	To perform a Hydraulic Analysis for the Site Drainage, since we will not alter the existing drainage pattern and will only replace the existing pavement without modifying the pavement slopes. \r\n2.	The existing building does not have a Sprinkler System, which could be required by the City based on actual Fire Code requirements. This a specialty service that we don’t provide. Plans for a Sprinkler System are not included.\r\n\r\n(These two items, will also be part of the consultation, when we approach the City of Dallas Sustainable Development & Construction Engineering Division).\r\n\r\nAs your acceptance to this proposal please sign below and we will return also a sign copy for your records.', NULL, NULL, 'eyJpdiI6IjU1MVZmVWY3TzVad2Y4UFhcL0x1N09RPT0iLCJ2YWx1ZSI6IkdiSzhZQnFCV0NPYXo5d242OWFONGc9PSIsIm1hYyI6ImI0ZWU5ZTM3MDQ3MDRiNzdkMjk4YWY3YmFlZDllMTFmMGJmNDMzZmJiOTcwOWU0M2RmMWFiNTdkMTg3YzNiZWQifQ==', 1, 2, '2020-06-29 20:06:28', NULL, 6),
