(349, 111, 'P', NULL, 'USDAL2000000111', 1, 2, '2020-08-21 00:00:00', 165, '1', 'OAKRIDGE HEIGHTS', NULL, NULL, 'KERENS', 'TX', 75144, 10, 25, 2, 'TYPE II', NULL, NULL, NULL, NULL, NULL, 'El cliente requiere hacer un diseño tomando de referencia el diseño de 5700 Point Lavista (Harbor original) agregándole  a este 130 pies y algunas ventanas.', NULL, NULL, 'eyJpdiI6IkYzWUhNYVAzdXMzZW9sU2pRMUpCWEE9PSIsInZhbHVlIjoiTmZ4M1RDdXJTYlhocU1ibHYzNmJ5dz09IiwibWFjIjoiYTIyM2MzMzRjYjE3YzY0YTRjZGIzMzFjOWY2OWYwYTIwMmY2MTdjY2M5MTAyYzNjYzYxMWJjNmYxMzkxZDM5ZSJ9', 1, 7, '2020-08-21 17:45:24', NULL, 2),
