(351, 112, 'S', 'Fence permit', 'USDAL2000000112', 1, 2, '2020-08-26 00:00:00', 101, '141', 'GLASS', 'ST', NULL, 'DALLAS', 'TX', 75207, 2, 6, 1, 'TYPE II', NULL, NULL, NULL, NULL, NULL, 'SE PROCESARA EL PERMISO EN EL PORTAL ONLINE DE LA CIUDAD DE DALLAS', NULL, NULL, 'eyJpdiI6InR1MDR2b0JVSHlSTzZNZ1NLYXBzR3c9PSIsInZhbHVlIjoid2JCM3FvbFpEV282NThrcmNjRjVQQT09IiwibWFjIjoiMWMyM2E1ODdjMDM3NWQ1NmNkOTVjMzhmZTc4NzMzMDEwZDI2ZDZiZTVjYjcwZTU3MmIwMTAzMTg5ZjYyYmQxZiJ9', 1, 6, '2020-08-26 18:28:42', NULL, 6),
(352, 113, 'P', NULL, 'USDAL2000000113', 1, 2, '2020-08-27 00:00:00', 277, '13327', 'Garden Grove', 'Dr', NULL, 'Dallas', 'TX', 75253, 10, 25, 2, 'TYPE III', NULL, NULL, NULL, NULL, NULL, 'Hacer una conversión de una edificación tipo galpón a una de tipo residencial usando la estructura existente, se debe detallar la estructura y hacer un diseño de interior para convertir esta edificación y revestirla de siding porque en la actualidad esta de láminas metálicas, este proyecto está bastante confuso xq tiñe mamotretos en la parte de atrás donde hay cría de animales y no sabemos como la ciudad vaya a tomar esto, a nuestros efectos nos guiaremos por el survey y representaremos esto como lo indica el survey y guardaremos los retiros que exigidos por la zonificación.\r\n\r\nNOTA; yo pienso que este proyecto podemos someterlo como una adicion ya que el cliente quiere añadir aproximadamente 300sqft y pienso perfectamente dejamos la estructura existente y se intenta someter como una adicion con remodelación.', NULL, NULL, 'eyJpdiI6IldzZWY4U3YxdkdMU0VRMUJyelQ2K2c9PSIsInZhbHVlIjoiTHg0RXJ1RFwvV1V0d0V4cmhvZmRxc3c9PSIsIm1hYyI6IjIyOGY0NWIxNTYxOWQxOWIzNGE5YmQ1YTlkNWQxZTMyNjBlYjRiYjRjNWNkOGFmZjBmNjgwYWI5NGMxZjUxZGIifQ==', 1, 2, '2020-08-27 15:51:13', NULL, 2),
(353, 114, 'P', 'Kevin\'s House', 'USDAL2000000114', 1, 2, '2020-08-28 00:00:00', 175, NULL, 'Elkins School', 'Rd', NULL, 'Fort Worth', 'TX', 76179, 10, 25, 2, 'TYPE II', NULL, NULL, NULL, NULL, NULL, 'Se requiere hacer un diseno para una casa de aprox 2700 pies cuadrados totales, partiendo del diseno anterior de la casa ubicada en 7204 Sam Cantey, a este diseno se le haran algunas modificaciones de forma, estas se explicaran en los datos previos.', NULL, NULL, 'eyJpdiI6ImRnaWZTVzZ4K0JNQlhEV1RidVNhWWc9PSIsInZhbHVlIjoiTVVRY29Rd1dLTlVwdTVncUlTVGxoUT09IiwibWFjIjoiOTg5OGM4NWQ1MDdlMDI2ZGIyMTYxNzRiMGUyMmIyYjgwOGViOWI0MTM5NzlhOGNlNDI5MTcxMzlmMjY4OGQwZSJ9', 1, 2, '2020-08-28 22:40:55', NULL, 6);
