INSERT INTO `invoice_scope` (`invScopeId`, `invoiceId`, `description`) VALUES
(1, 129, 'SE REALIZARA UN TOPO SURVEY QUE SOLICITAREMOS A LA COMPANIA RHODES.'),
(3, 128, 'Make the 3D of the roof plan of the existing house with reference to the floor plan of the Contract USDAL19P00148.'),
(4, 130, 'Center rear windows and doors'),
(5, 130, 'Make back columns symmetrical'),
(6, 130, 'Add 7x1 chimney'),
(7, 130, 'Make pool 13x30'),
(8, 131, 'Draw the site plan to indicate the remodeled area.'),
(9, 131, 'Draw the existing floor plan of a portion of the existing building with an approximate area of ​​2500sqft divided into two areas according to the sketch.'),
(10, 131, 'Design the modified floor plan by dividing spaces for office use in one area and use of multiple rooms in the other area.'),
(11, 131, 'Design the system of mechanical installations for air conditioning taking into account common returns for the office area.'),
(12, 131, 'We will indicate in the floor plan the existing fire sprinklers this does not include new design or calculations of fire sprikler.'),
(13, 131, 'Confirm the separation of the studes on the metal walls and make construction details.'),
(14, 131, 'The electrical plan only includes the remodeled portion and its connection to the existing panel.'),
(15, 132, 'A POST-TENSED FOUNDATION WILL BE MADE OF THE BUILDING DESIGN DELIVERED IN DOCUMENT R6 3506 EL BENITO DR DALLAS TX.'),
(16, 132, 'THE SOIL STUDY SUPPLIED BY THE CUSTOMER WILL BE TAKEN AS A REFERENCE'),
(17, 133, 'The project USDAL2000000041 must be replicated with change of an external finish of sidding.'),
(18, 134, 'A 14 feet deep front carport with gabled roof must be added to the accessory structure project.'),
(19, 134, 'The same internal distribution of the existing part will be preserved.'),
(20, 134, '4\" Slab on the floor with pears under the post will be made.'),
(21, 134, 'Two 6\'x6\' wood post will be place on each corner.'),
(22, 136, 'The kitchen will be enlarged and the new space will be accommodated.'),
(23, 136, 'An existing porch will be covered to make it a living space.'),
(24, 136, 'The Rescheck includes a report and two inspections at the time of construction.'),
(25, 136, 'The permitting process includes attending to the deliveries and corrections of the city regarding what the company is doing in this contract.'),
(26, 137, 'The main scope is the construction of a second floor on the front of the house.'),
(27, 137, 'The framing structure will be calculated'),
(28, 137, 'MEP plans will only be made schematic and the services will be connected to what exists.'),
(29, 137, 'Rescheck Includes a report at the time of processing the permit and two inspections in the construction phase.'),
(30, 137, 'Permit processing includes only delivering and serving city requests and ends upon approval of the permit.'),
(31, 137, 'The addition is contemplated to make approx 800 sq ft'),
(32, 137, 'The engineering services have an inspection and report of the existing foundation before construction and at the time of construction an inspection of the framing will be made.'),
(33, 138, 'Permit processing for CO only'),
(34, 140, 'The plans received by the client will be redrawn.'),
(35, 140, 'The plans will be verified against the IBC 2018 codes.'),
(36, 142, 'The foundation will be designed with data from the web soil of the United States Department of Agriculture.'),
(37, 142, 'The framing ceiling and framing roof will be designed.'),
(38, 142, 'The 3D modeling of the house will be carried out and 6 rendering images will be generated.'),
(39, 143, 'FULL SET OF PLANS FOR NEW CONSTRUCTION SINGLE FAMILY HOME.'),
(40, 144, 'Make drawings of existing floor plan, demolition plan and modified plans.'),
(41, 144, 'calculate and propose structure that supports open space by minimizing the use of columns.'),
(42, 145, 'Remodeling of the second floor, existing architectural plans and proposed distribution are made, on this modification electrical and plumbing plans will be made.'),
(43, 145, 'Management will be done online to obtain permits from the City of Houston.'),
(44, 146, 'Design a new house of approximately 2215 sqft. With a main room with master bathroom and 2 bedrooms and an additional bathroom, with living room, kitchen and dining room with a two-car garage in front of the house.'),
(45, 146, 'Design the civil plans of the site to connect the utilities to the public service of the city and design the surface drainage of rainwater.'),
(46, 146, 'The design of the house will be made using as reference the design sent in images by the client on 7/20/2020 via email.'),
(47, 147, 'It is proposed to make the design for a single-family one-story house.'),
(48, 147, 'The slab foundation design will be made.'),
(49, 147, 'MEP plans will be schematic.'),
(50, 147, 'The energy codes are included with the report and two inspections.'),
(51, 147, 'Permission processing is not included.'),
(52, 148, 'A simple one-story family home will be designed with a modern Prairie model, with 4 bedrooms and 3 bathrooms.'),
(53, 148, 'It will have a total of approximately 2700 square feet of construction.'),
(54, 148, 'The foundation will be slab over grade, it will have brick on the sides and back and stucco on the front combined with brick.'),
(55, 148, 'Does not include permit processing or energy codes.'),
(56, 150, 'It is proposed to do an interior remodeling of an existing restaurant, it is contemplated in this scope to modify the\nlocation of some non-structural walls to adapt the facilities according to the new design.'),
(57, 150, 'It is proposed to make the interior design according to the specifications of the CULICHI TOWM franchise with\nreference plans.'),
(58, 150, 'It is proposed to make the MEP plans for the new design.'),
(59, 150, 'If required, a letter from the engineer is contemplated to notify the city that the internal changes are not structural.'),
(60, 150, 'This scope does not include reports of; existing foundations, existing building structure or to determine if the weight of air conditioning units supports the existing structure.'),
(61, 150, 'It is proposed to do the 3D modeling to visualize details.'),
(62, 151, 'It is proposed to add to the existing house 24 x 26 in the back to make two rooms, a dinning room and a bathroom.'),
(63, 151, 'A hip is proposed to connect to the existing ridge above the house.'),
(64, 151, 'The foundation is existing so it will not be designed, it is only offered to make the internal distribution of the walls.'),
(65, 151, 'The electricity and plumbing will only be schematic, it will not be calculated.'),
(66, 152, 'The set of plans will be designed an accessory structure for storage and garage use of approx 1000 sq ft.'),
(67, 152, 'Foundation will be slab, exterior siding or brick.'),
(68, 152, 'Dimensions will be 45 x 20 feet'),
(70, 149, 'It is proposed to make a modification to the floor plan.'),
(71, 153, 'The scope of work is based on the design of a Truck Repair Shop Building including an Office and its facilities. However, the first step will be to Develop the Site to accommodate the building and the associated vehicle circulation, parking, Fire Truck access and fire hydrant arrangement, Dumpster operation, and Drive-way connection to the public road through the proper grading, paving and drainage plan to comply with the City of Dallas Code requirements. Also, design of an erosion and pollution control plan during construction and the connection of the property utilities to the City public stormwater, water and wastewater systems.'),
(72, 153, 'We will perform a hydraulic analysis to establish 100 yr., 50 yr. and 25 yr. flood elevations and to determine a Finish Floor Elevation (FFE) to set building above the 100 year flood and to define the most economical elevations for vehicle stacking and parking to minimize the cost of Flood Insurance. The hydraulic analysis is the basis to comply with the City and FEMA requirements to accomplish a new floodway delineation that will allow the construction permitting at this site.'),
(73, 153, 'We propose to develop the site though the appropriate grading and paving to allow for the maximum stacking, circulation and parking areas surrounding the building. The area next to the creek should be left with minimum development for the possible location of a Detention Pond to control the drainage on to the creek under flooding conditions.'),
(74, 153, 'Our proposal is based on a 2,500 sq.ft. building for the Truck Repair Shop and Office.'),
(75, 154, 'A new house will be designed with 3 bedrooms, 2 bathrooms, kitchen and dining room.'),
(76, 154, 'All plans will be designed based on Oak Point City codes and requirements.'),
(77, 154, 'The requested energy report will be made to submit the permit. .'),
(78, 154, 'Visits will be made to complete the permit processes with the city'),
(79, 155, 'An inspection of the existing foundation will be made with an Engineering report'),
(80, 155, 'Design for repair will be proposed if required according to the conditions of the existing foundation'),
(81, 156, 'Reports requested by the city to obtain the permit are offered. Inspections are not included in this proposal.'),
(82, 157, 'The ground will be leveled to lower the finish floor elevation with respect to the height of the street.'),
(83, 157, 'A French drain will be placed in front.'),
(84, 157, 'The amount of cut and fill will be determined.'),
(85, 158, 'It is proposed to make a 35x26 covered patio of cedar wood, a proposal will be made for the approval of the HOA then the set of plans will be completed.'),
(86, 159, 'It is proposed to demolish the existing structure.'),
(87, 159, 'A house of approximately 1800 square feet will be designed.'),
(88, 159, 'The design will include 3 bedrooms, 2 bathrooms, kitchen, laundry room and dining room.'),
(94, 160, 'The previous proposal made in metal will be redefined to wood with 2x6 walls and trusses.'),
(95, 160, 'The same design and dimensions will be kept the same as the previous design.'),
(96, 161, 'The full set of plans indicated in the list will be made, starting from a finished design and which will be added 130 square feet.'),
(97, 161, 'Some windows will be added but no changes will be made to the internal layout.'),
(98, 161, 'Energy reports will be delivered on how the insolation should be placed. Inspections are not included.'),
(99, 162, 'Plans will be made regarding the framing of the house, representing the existing framing of walls, ceiling and roof, of the first and second floors.'),
(100, 163, 'The plans and information provided by the client for obtaining this permit for a fence will be uploaded into the City of Dallas system.'),
(101, 163, 'The specifications mentioned in the plans will be followed.'),
(102, 164, 'In this budget it is contemplated to make an interior remodeling for an existing metal building of approximately 950 sqft to convert it into a building for residential use to comply with the zoning codes, also it is contemplated to make the elevations of the building to propose siding and remove metal sheets exist.'),
(103, 164, 'The existing structures located in the rear of the project reflected in the survey as covered bar area were not considered in this budget, if the city requires any work in this area it will be an additional budget.'),
(104, 165, 'This proposal includes the full set of construction plans.'),
(105, 165, 'The design will be readjusted based on a previous design on Sam Cantey Street.'),
(106, 165, 'The house will be approx 2700 Sq Ft.');
