(212, 168, 'P', 'TRUCK REPAIR SHOP BUILDING', 1, 2, '2020-07-22', 261, '12201', 'C. F. HAWN', 'FREEWAY', NULL, 'DALLAS', 'TX', 75253, 1, 1, 1, 'TYPE III', 'Este proyecto consiste en dos cosas fundamentales, una edificación con dos area una para uso de oficina y la otra para mantenimiento de camiones, lo segundo es el diseño del pavimento para estacionar camiones.\r\n\r\nLa particularidad de este proyecto es que se inunda con 100 anos de periodo de retorno y para esto es necesario ofrecer una solución hidráulica que permita tanto la construcción de la edificación como el estacionamiento para camiones.\r\n\r\npreviamente se harán planos esquemáticos para hacer una reunion con la ciudad y determinar la factibilidad del proyecto una ves aprobado o recibido los lineamientos de la ciudad se hará todos los planos para la edificación y el desarrollo del terreno incluyendo un estudio hidrológico para determinar la solución a nivel hidráulico.\r\n\r\nDe acuerdo a lo previo observado se debe proponer un relleno para elevar la cota de la fundación por encima de la fundación para este excedente de agua se propondrá una laguna artificial, esto es un bosquejo previo.\r\n\r\nLa edificación sera de máximo 2500sqft totales\r\n\r\nPor favor verificar si el uso sugerido en IBC es correcto si no por favor modificar.', 'eyJpdiI6IlJ0YWFOSXNHeEZZbXRMalwvRXo2VjR3PT0iLCJ2YWx1ZSI6IlQrR3ROQmo4M2Q1bFJiWXFWbVFFZFE9PSIsIm1hYyI6Ijk4YzdmODM5YjJhYWI4MGE5NTlhNzU2NzYwYmUxYjE5YTY0MTljYWVmYTM4ODdjYzYwYzU0NDgyOTcyOTdiMDUifQ==', 1, 344, NULL),
